// import React, { useState } from "react";
import Navbar from "../components/Navbar";
import "./APTG.css";

function APTG() {
  const [selectedCategory, setSelectedCategory] = useState(""); // Track selected category

  const categories = {
    "Macherla 1st Week Gross ATRs Since 2005": [
      "Samba 2004 2.55L",
      "Gudumba Shankar 2004 2.61L",
      "Shankar Dada MBBS 2004 3.15L",
      "Stalin 2006 3.37L",
      "Annavaram 2006 3.22L",
      // ... Add other entries here
    ],
    // ... Other categories here
  };

  return (
    <div className="APTG">
      <Navbar />
      <h1>APTG</h1>
      <div className="category-list">
        {Object.keys(categories).map((category) => (
          <button
            key={category}
            onClick={() => setSelectedCategory(category)}
            className="category-button"
          >
            {category}
          </button>
        ))}
      </div>
      <div className="table-container">
        {selectedCategory && (
          <>
            <h2>{selectedCategory}</h2>
            <ul>
              {categories[selectedCategory].map((item, index) => (
                <li key={index}>{item}</li>
              ))}
            </ul>
          </>
        )}
      </div>
    </div>
  );
}

function PreReleaseBusiness() {
  const [selectedTable, setSelectedTable] = useState("table1");

  const table1Data = [
    { movie: "Movie A", region: "Region 1", amount: "10 Cr" },
    { movie: "Movie B", region: "Region 2", amount: "15 Cr" },
    // Add more rows here
  ];

  const table2Data = [
    { distributor: "Distributor X", rights: "Area 1", price: "5 Cr" },
    { distributor: "Distributor Y", rights: "Area 2", price: "8 Cr" },
    // Add more rows here
  ];

  return (
    <div className="PreReleaseBusiness">
      <Navbar />
      <h1>Pre-Release Business</h1>
      <div className="table-switcher">
        <button
          onClick={() => setSelectedTable("table1")}
          className={selectedTable === "table1" ? "active" : ""}
        >
          Table 1
        </button>
        <button
          onClick={() => setSelectedTable("table2")}
          className={selectedTable === "table2" ? "active" : ""}
        >
          Table 2
        </button>
      </div>
      <div className="table-container">
        {selectedTable === "table1" && (
          <table className="data-table">
            <thead>
              <tr>
                <th>Movie</th>
                <th>Region</th>
                <th>Amount</th>
              </tr>
            </thead>
            <tbody>
              {table1Data.map((row, index) => (
                <tr key={index}>
                  <td>{row.movie}</td>
                  <td>{row.region}</td>
                  <td>{row.amount}</td>
                </tr>
              ))}
            </tbody>
          </table>
        )}
        {selectedTable === "table2" && (
          <table className="data-table">
            <thead>
              <tr>
                <th>Distributor</th>
                <th>Rights</th>
                <th>Price</th>
              </tr>
            </thead>
            <tbody>
              {table2Data.map((row, index) => (
                <tr key={index}>
                  <td>{row.distributor}</td>
                  <td>{row.rights}</td>
                  <td>{row.price}</td>
                </tr>
              ))}
            </tbody>
          </table>
        )}
      </div>
    </div>
  );
}

export { APTG, PreReleaseBusiness };
